@zevross The way people generally avoid this problem is

if(a &gt; cutoff) {
...
} else { ## a &lt;= cutoff
...
} ## end if a &gt; cutoff

You see this various places in the code of #rstats itself. Code collapsing as can be done in modern IDEs can also help

